import React, { useState, useRef, useEffect } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [messages, setMessages] = useState([
    {
      role: 'assistant',
      content: '🌍 Welcome to Travel AI Agent! I\'m your privacy-first travel planning assistant. Ask me about countries, plan trips, get weather info, or search for flights and hotels. All your data stays on your device!'
    }
  ]);
  const [input, setInput] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const messagesEndRef = useRef(null);

  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
  };

  useEffect(() => {
    scrollToBottom();
  }, [messages]);

  const sendMessage = async () => {
    if (!input.trim() || isLoading) return;

    const userMessage = input.trim();
    setInput('');
    setIsLoading(true);

    // Add user message
    setMessages(prev => [...prev, { role: 'user', content: userMessage }]);

    try {
      const response = await axios.post('/chat', {
        message: userMessage
      });

      // Add agent response
      setMessages(prev => [...prev, { 
        role: 'assistant', 
        content: response.data.response 
      }]);

    } catch (error) {
      console.error('Error:', error);
      setMessages(prev => [...prev, { 
        role: 'assistant', 
        content: 'Sorry, I encountered an error. Please try again.' 
      }]);
    } finally {
      setIsLoading(false);
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter' && !e.shiftKey) {
      e.preventDefault();
      sendMessage();
    }
  };

  const exampleQueries = [
    "Tell me about Peru",
    "Plan a trip to Japan with $3000 budget",
    "What's the weather in Tokyo?",
    "Find flights to Paris in January",
    "Budget hotels in Bangkok under $50/night"
  ];

  return (
    <div className="app">
      <header className="app-header">
        <h1>🌍 Travel AI Agent</h1>
        <p>Privacy-first travel planning • Local AI • No data leaves your device</p>
      </header>

      <div className="chat-container">
        <div className="messages">
          {messages.map((message, index) => (
            <div key={index} className={`message ${message.role}`}>
              <div className="message-content">
                {message.content}
              </div>
            </div>
          ))}
          {isLoading && (
            <div className="message assistant">
              <div className="message-content">
                <div className="typing-indicator">
                  <span></span>
                  <span></span>
                  <span></span>
                </div>
              </div>
            </div>
          )}
          <div ref={messagesEndRef} />
        </div>

        <div className="input-area">
          <div className="input-container">
            <textarea
              value={input}
              onChange={(e) => setInput(e.target.value)}
              onKeyPress={handleKeyPress}
              placeholder="Ask about travel planning, countries, flights, hotels..."
              rows="1"
              disabled={isLoading}
            />
            <button 
              onClick={sendMessage} 
              disabled={!input.trim() || isLoading}
              className="send-button"
            >
              {isLoading ? '⏳' : '🚀'}
            </button>
          </div>
        </div>

        <div className="examples">
          <h3>Try these examples:</h3>
          <div className="example-buttons">
            {exampleQueries.map((query, index) => (
              <button
                key={index}
                className="example-button"
                onClick={() => setInput(query)}
                disabled={isLoading}
              >
                {query}
              </button>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
